import React from 'react';
import Card from './Card';

const CardList = ({ items }) => {
    return (
        <div
            style={{
                display: 'flex',
                flexWrap: 'wrap',
                width: '90%',
                justifyContent: 'center',
            }}
        >
            {items.map((prod) => (
                <Card prod={prod} key={prod.id} />
            ))}
        </div>
    );
};

export default CardList;
